INSERT INTO wf_rew_point(id, name, pjtRole, remark, orderNum, isValid, isShowCategory, status, creatorId, createdTime, modifyId, modifyTime) VALUES ('69ee712e-fbdd-432e-96a8-8063fa0a2923', '项目启动评审-TR1', NULL, '项目目标和范围的明确定义。\r\n需求和利益相关方期望的明确理解。\r\n项目的可行性分析,包括预算和资源需求。\r\n项目章程和项目管理计划的制定。', '1', 'Y', 'Y', 'RN', 'b8ab9427-627b-469f-bfd0-4b1buser0001', '2022-08-08', 'b8ab9427-627b-469f-bfd0-4b1buser0001', '2022-08-08');
